using Microsoft.Maui.Controls;
using Travely.Client.Models;

namespace Travely.Client.Pages;

public partial class TripsPage : ContentPage
{
	public TripsPage()
	{
		InitializeComponent();
        tripsCollection.ItemsSource = GetTrips();
	}

    public void AddTrip(TripViewModel trip)
    {
        var trips = (List<TripViewModel>)tripsCollection.ItemsSource;
        trips.Add(trip);
        tripsCollection.ItemsSource = null;
        tripsCollection.ItemsSource = trips;
    }

    private async void StartPlanningClicked(object sender, EventArgs e)
    {
        await Navigation.PushAsync(new PlanTripPage());
    }

    private List<TripViewModel> GetTrips()
    {
        return new List<TripViewModel>
        {
            new TripViewModel {CountryName="Paris", StartDate = new DateTime(2024, 5, 1), EndDate = new DateTime(2024, 5, 10), CountryURL="data:image/jpeg;base64,"},
            new TripViewModel {CountryName="Milano", StartDate = new DateTime(2024, 5, 1), EndDate = new DateTime(2024, 5, 10), CountryURL="data:image/jpeg;base64,"},
            new TripViewModel {CountryName="Napoli", StartDate = new DateTime(2024, 5, 1), EndDate = new DateTime(2024, 5, 10), CountryURL="data:image/jpeg;base64,"},
        };
    }
}